         <tr>
           {tableColumnsFiltered.map((d, i) =>
             <th key = {i}> {d} </th>
             )}
         </tr>
       </thead>
       )
  }



    // const headers = this.props.columns.map((d, i) =>
    //   <div key = { "headers" + i}

    //   />
    // )

    return (
      <table className = "table">
      { headers }
      </table>
      )
  }
}

